window.bookSummaryJSON = "<p>The evil Librarians are coming! A hero with an incredible talent...for breaking things. A life-or-death mission...to rescue a bag of sand. A fearsome threat from a powerful secret network...the evil Librarians.</p> <p>Alcatraz Smedry doesn't seem destined for anything but disaster. On his 13th birthday, he receives a bag of sand, which is quickly stolen by the cult of evil Librarians plotting to take over the world. The sand will give the Librarians the edge they need to achieve world domination. Alcatraz must stop them...by infiltrating the local library, armed with nothing but eyeglasses and a talent for klutziness.</p>"; 
